B.EV=new A.bg(B.bo,4,0,B.rj,3,"It's a remote-controlled car with a bomb attached to it! To attack, drop an RC Car, facing any direction, within Short range of the attacker (Collision Window).\n\nThe RC Car is a lightweight vehicle in current Gear 3, with 1 Hull Point, 1 Crew, and 0 Handling. Though not officially part of the team, it is controlled as a separate vehicle by the attacker. It can make shooting attacks with a mounted Handgun, but it cannot change Gear.\n\nIf an RC Car is involved in a Collision or Wipeout, it immediately suffers one point of damage before resolving other effects. When it would be Wrecked, it instead explodes with a 4D6 Large Burst attack.\n\nOPTIONAL: Instead of operating as an independent vehicle, the RC Car must be moved and fired by a dedicated Crew member during the Attack Step. If no Crew member is assigned (or available), the RC Car simply moves using the Medium Straight template.",27,"rcCarBombs")
